import React from 'react';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Login from './Pages/Login.js';
import Home from './Pages/Home.js';

function App() {
  return (
   <div>
      <BrowserRouter>
      <Routes>
        <Route index element={<Login />} />
        <Route path="/home" element={<Home/>} />
      </Routes>
      </BrowserRouter>
   </div>
  )
}

export default App;
